import React from 'react';

import "../App.css";

const Auth = () => {
  return (
    <div className="wrapper">
      <center><h1>Auth</h1></center>
      <div className="auth-left">
          <h2>Sign In</h2>
      </div>
      <div className="auth-right">
          <h2>Create an Account</h2>
      </div>
    </div>
  );
};

export default Auth;
